import React, { Component } from "react";
import { Container } from "react-bootstrap";

class Footer extends Component {
  state = {};
  render() {
    return (
      <Container className="text-center">
        <p>RIOTU Lab &copy; 2020</p>
      </Container>
    );
  }
}

export default Footer;
